import React from 'react';

const TestCard = ({it}) => {

    return (
        <div className="col-6">
            <div className="m-2">
                <p>{it.question}</p>
                <label>
                    {it?.answers?.map( it => {
                            return <>{it}</>
                        }

                    )

                    }
                </label>

            </div>
        </div>
    );
};

export default TestCard;
